import React from "react";
import PropTypes from "prop-types";
import StyledVideoCall, { Action, Actions, Minimize, Self } from "./style";
import videoCaller from "assets/images/video-caller.jpg";
import face from "assets/images/face-male-1.jpg";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCompressAlt, faMicrophone, faPhoneSlash, faVolumeMute } from "@fortawesome/free-solid-svg-icons";

function VideoCall({ children, ...rest }) {
  return (
    <StyledVideoCall src={videoCaller} {...rest}>
      <Minimize shape="rect">
        <FontAwesomeIcon icon={faCompressAlt} />
      </Minimize>
      <Actions>
        <Action>
          <FontAwesomeIcon icon={faMicrophone} />
        </Action>
        <Action type="hangoff">
          <FontAwesomeIcon icon={faPhoneSlash} />
        </Action>
        <Action>
          <FontAwesomeIcon icon={faVolumeMute} />
        </Action>
      </Actions>
      <Self src={face} size="140px" />
    </StyledVideoCall >
  );
}

VideoCall.propTypes = {
  children: PropTypes.any
};

export default VideoCall;
